import React from "react";
import Navigation from "./Navigation";
import Link from "next/link";
import EngLangButton from "../Components/EngLangButton";
import SweLangButton from "../Components/SweLangButton";
import styled from "styled-components";
import Image from "next/image";

const StyledHeader = styled.header`
  background-color: #292929;
  padding: 20px;
`;

export default React.forwardRef(function Header(props, ref) {
  return (
    <StyledHeader ref={ref}>
      <Link href="/">
        <Image src="/Home.png" alt="Home" width="40px"></Image>
      </Link>
      <EngLangButton />
      <SweLangButton />
      <Navigation />
    </StyledHeader>
  );
});
